import React from 'react';
import PropTypes from 'prop-types';
import './Product.scss';
import phones from '../../data/phones.json';

export const Product = ({ name, price, images, id }) => {
  return (
    <div className="Product">
      <div className="Product-InfoContainer">
        <button className="Product-Close">{}</button>
        <img
          className="Product-Image"
          src={images[0]}
          width="66px"
          height="66px"
          alt="Phone"
        />
        <p className="Product-Name">{name}</p>
      </div>
      <div className="Product-CountContainer">
        <button className="Product-Remove buttonProduct" disabled={true}>{}</button>
        <div className="Product-Quantity">{}</div>
        <button className="Product-Add buttonProduct">{}</button>
      </div>
    </div>
  )
}

Product.propTypes = {
  images: PropTypes.arrayOf(PropTypes.string.isRequired,
  ).isRequired,
  name: PropTypes.string.isRequired,
  price: PropTypes.arrayOf(PropTypes.number.isRequired).isRequired,
  id: PropTypes.number.isRequired,
  // type: PropTypes.string.isRequired,
  // tech: PropTypes.arrayOf(PropTypes.array.isRequired,
  //   ).isRequired,
};
